import styled from 'styled-components';

export const Content = styled.main`
  display: flex;
  justify-content: center;
  align-items: center;

  flex-direction: column;
`;

export const ProfileAvatar = styled.div`
  img {
    height: 186px;
    width: 186px;
    border-radius: 50%;
  }
`;
